// @ts-nocheck
/** @jsx jsx */
import { jsx, Image } from 'theme-ui';
import { Link } from 'components/link';

export default function Logo({ src, ...rest }) {
  return (
      <Link
        path="/"
        sx={{
          variant: 'links.logo',
          display: 'flex',
          cursor: 'pointer',
          mr: 15,
          width:'50px',
          height: '50px'

        }}
        {...rest}
      >
          <Image src={src} alt="Agromat fiky page logo"/>
      </Link>
  );
}
